{% raw %}
{% set cfxql_pass_query = "test_result is 'Pass' and agent_id is '" ~ context.agent_id ~ "'" %}
{% set all_llm_passed = engine.query_stream_aggs(stream="rda_agentic_ai_agent_test_executions", cfxql_query=cfxql_pass_query, aggs=[{"field":"count_", "label": "Passed","func":"sum"}],groupby=["llm"], duration_hours=1800000, ts_column="timestamp") %}

{% set cfxql_total_query = "agent_id is '" ~ context.agent_id ~ "'" %}
{% set all_llm_total = engine.query_stream_aggs(stream="rda_agentic_ai_agent_test_executions", cfxql_query=cfxql_total_query, aggs=[{"field":"count_", "label": "Total","func":"sum"}],groupby=["llm"], duration_hours=1800000, ts_column="timestamp", sorting=[{"llm": "desc"}]) %}

<div style="width: 100%; height: 100%; background: transparent; display: flex; gap: 10px; align-items: center; overflow-x: auto">
    {% for llm_data in all_llm_total %}
        {% set llm_name = llm_data.llm %}
        {% set total = llm_data.Total %}
        {% set passed_data = all_llm_passed | selectattr("llm", "equalto", llm_name) | list %}
        {% set passed = passed_data[0].Passed if passed_data else 0 %}
        {% set accuracy = (passed / total * 100) if total > 0 else 0 %}
        
        {% set color = "red" %}
        {% if accuracy >= 75 %}
            {% set color = "green" %}
        {% elif accuracy >= 50 %}
            {% set color = "orange" %}
        {% endif %}
        
        <div style="min-width: 120px; width: 120px; max-width: 120px; height: 80px; background: #1c1e22; padding: 8px; border-radius: 6px; text-align: center; overflow: hidden">
            <p style="font-size: 10px; color: #cccccc; margin: 0; height: 30px">{{ llm_name }}</p>
            <p style="font-size: 16px; font-weight: bold; color: {{ color }}; margin: 4px 0;">{{ accuracy | round(1) }} <span style="font-size: 12px; font-weight: normal; color: white;">%</span></p>
        </div>
    {% endfor %}
</div>
{% endraw %}

